#include <gtest/gtest.h>
#include <sstream>
#include <iostream>
#include <fstream>
#include <string>
using namespace std;
string strarr[4];
string Walktober(string str)
{
  istringstream is(str);
  int T;
  is >> T;
  string output = "";
  for (int i = 1; i < T + 1; i++)
  {
    int M, N, P;
    is >> M;
    is >> N;
    is >> P;
    int table[M + 1][N];
    int totalnum = 0;
    for (int j = 1; j < M + 1; j++)
    {
      for (int k = 0; k < N; k++)
      {
        is >> table[j][k];
      }
    }
    for (int j = 0; j < N; j++)
    {
      int maxnum = 0;
      for (int k = 1; k < M + 1; k++)
      {

        if (table[k][j] > maxnum)
        {
          maxnum = table[k][j];
        }
      }
      if (table[P][j] < maxnum)
      {
        totalnum += maxnum - table[P][j];
      }
    }
    // cout << "Case #" << i << ": " << totalnum << "\n ";

    output += "Case #" + to_string(i) + ": " + to_string(totalnum) + "\n ";
  }
  return output;
}

TEST(Sample, sample_ts1)
{
  string str;
  str = "1 2 3 1 1000 2000 3000 1500 1500 3000";
  EXPECT_EQ(Walktober(str), "Case #1: 500\n ");
}
TEST(Sample, sample_ts2)
{
  string str;
  str = "2 3 2 3 1000 2000 1500 4000 500 4000 3 3 2 1000 2000 1000 1500 2000 1000 500 4000 1500 ";
  EXPECT_EQ(Walktober(str), "Case #1: 1000\n Case #2: 2500\n ");
}
